<script>
document.addEventListener('DOMContentLoaded', function() {
    // Esperar a que Folium cargue el control de capas
    setTimeout(function() {
        const control = document.querySelector('.leaflet-control-layers');
        if (control) {
            // Agregar clase para animación
            control.classList.add('animated-control');
            
            // Agregar botón para colapsar/expandir
            const toggleBtn = document.createElement('div');
            toggleBtn.innerHTML = '<i class="fas fa-chevron-down"></i>';
            toggleBtn.style.position = 'absolute';
            toggleBtn.style.right = '10px';
            toggleBtn.style.top = '10px';
            toggleBtn.style.cursor = 'pointer';
            toggleBtn.style.color = '#7f8c8d';
            toggleBtn.style.transition = 'transform 0.3s ease';
            control.prepend(toggleBtn);
            
            // Manejar evento click
            toggleBtn.addEventListener('click', function() {
                const list = control.querySelector('.leaflet-control-layers-list');
                if (list.style.display === 'none') {
                    list.style.display = 'block';
                    toggleBtn.style.transform = 'rotate(0deg)';
                    control.style.height = 'auto';
                } else {
                    list.style.display = 'none';
                    toggleBtn.style.transform = 'rotate(-90deg)';
                    control.style.height = '40px';
                }
            });
        }
    }, 1000); // Retraso para asegurar carga
});
</script>
